import React, { useEffect } from "react";
import Link from "next/Link";

function Page() {
  const notes = new Array(10).fill(1).map((e, i) => ({ id: i, title: `Note: ${i}` }));

  return (
    <>
      <h1>All notes here</h1>

      {notes.map((note) => {
        <div>
          <Link key={note.id} href="/notes/[id]" as={`/notes/${note.id}`}>
            <a>Click on Notes</a>
          </Link>
        </div>;
      })}
    </>
  );
}

export default Page;
